import React from "react";
import { Link, Router } from "react-router-dom";

function Home(props) {
  return (
    <div>
      <form onSubmit={this.handleSubmit}>
        <label>
          Name
          <input
            type="text"
            name="name"
            value={this.nameIn}
            onChange={this.handleNameChange}
          />
        </label>
        <label>
          quote
          <input
            type="text"
            name="quote"
            value={this.quoteIn}
            onChange={this.handleQuoteChange}
          />
        </label>
        <input type="submit" value="Add to DB" />
      </form>
    </div>
  );
}

